    false,nt"url": null,nt"notes": "This report describes the evaluation of
    ungulate browsing at six wildlife refuges in FWS Region 6 in 2009. The aim of evaluation
    was to determine if ungulate browsing occurred at an acceptable level, or not. Developing
    an objective means of making that distinction was part of the process. While evaluation
    was our focus, the report incorporates evaluation into a more comprehensive program
    of adaptive ungulate management. The intent is to illustrate how this could be done,
    and does not imply that such a program was implemented at the respective refuges.
    Given the brief amount of time spent at each refuge, the evaluations should be viewed
    as an indication of what would likely be found if more-intensive efforts were made.
    In addition, the report is intended to serve as a how-to guide for biologists wishing
    to independently develop adaptive management programs.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
